import React from "react";

import "./styles/Item.css";

class Item extends React.Component {
  render() {
    return (
      <div className="Item">
        <div className="row">
            <div className="col-4">
                <div className="Item__Circulo"></div>
            </div>
            <div className="col-8 Item__Info">
                <p className="Item__Name">Humano </p>
                <p className="Item__Creado">Creado en: </p>
            </div>
        </div>
        <div className="row Item__Muta">
            <spam className="Item__Muta"> Mutado </spam>
        </div>
      </div>
    );
  }
}

export default Item;
